import React from 'react';
import PostCard from 'app/main/reusables/PostCard'
import axiosInstance from 'app/main/axios';
import {useState, useEffect} from 'react';

export default function PostsTab()
{
    const [posts, setposts] = useState(null);

    {useEffect(() => {
        axiosInstance.get('my-post-list/').then(res => {
            setposts(res.data);
        });
    }, []);}

    if(!posts)
    {
        return null;
    }

    return(
        posts.map(item => (<PostCard item = {item} />))
    )

}
